      Dance_Party_extras_intro:
        markdown: "# ڈانس کرتے رہیں!\n\n حصہ 2 کے لئے، آپ اپنا خود کا پروجیکٹ تیار
          کرنے لگے ہیں۔ یہاں کوئی پزلز نہیں ہیں - اس کے بجائے یہاں پروجیکٹس کا گروپ
          ہے جو مزید پیچیدہ ڈانس پارٹیاں بنانے کے مختلف طریقے دکھاتا ہے۔ آپ یہ لیولز
          _کسی بھی ترتیب میں_ کر سکتے ہیں۔ یہ دیکھنے کے لئے اردگرد چھلانگ لگائیں کہ
          گزشتہ لیول میں کچھ کیسے ہوا تھا، یا پراجیکٹس کے درمیان تصورات کو یکجا کریں۔
          ان تمام کو آزمائیں، اپنی پسند منتخب کریں، اور اسے اپنا بنانے کے لئے اس پروجیکٹ
          میں شامل کرنے کا کام کرنے اپنا وقت صرف کریں۔\n\n<a class=\"btn btn-large
