      Dance_Party_extras_intro_2019:
        markdown: |-
          # ناچتے رہو!

          حصہ 2 کے ل you're ، آپ خود اپنا پروجیکٹ تیار کرنے جارہے ہیں۔ یہاں کوئی پہیلیاں نہیں ہیں - بجائے اس کے کہ ایسے پروجیکٹس کا ایک گروپ ہے جو رقص کی زیادہ پیچیدہ جماعتیں بنانے کے مختلف طریقے دکھاتا ہے۔

          آپ یہ درجات کسی بھی آرڈر _ میں کرسکتے ہیں۔ پچھلے درجے میں کچھ کیا ہوا تھا ، یا پروجیکٹس کے مابین تصورات کو یکجا کرنے کے لئے یہ دیکھنے کے لئے ادھر ادھر جائیں۔ ان سب کو آزمائیں ، اپنی پسند کا انتخاب کریں ، اور اپنا منصوبہ بنانے کے ل own اس منصوبے میں شامل کرنے میں اپنا وقت گزاریں۔

